import React from "react";
import { Link } from "react-router-dom";
import logo from "../logo.jpg";
// import { ButtonElement } from "./Button";
// import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// import { faShoppingCart } from "@fortawesome/free-solid-svg-icons";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light px-sm-5">
      <a className="navbar-brand" href="#nav">
        Navbar
      </a>
      <button
        className="navbar-toggler bg-light"
        type="button"
        data-toggle="collapse"
        data-target="#navbarToggler"
        aria-controls="#navbarToggler"
        aria-expanded="false"
        aria-label="Toggle navigation"
      >
        <span className="navbar-toggler-icon" />
      </button>
      <div className="collapse navbar-collapse" id="#navbarToggler">
        <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
          <li className="nav-item active">
            <a className="nav-link" href="#hom">
              Home <span class="sr-only">(current)</span>
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#lin">
              Link
            </a>
          </li>
        </ul>
      </div>
    </nav>

    // <nav classNameName="navbar navbar-expand-xs  bg-dark ">
    //   <img src={logo} alt="logo" classNameName="navbar-brand" />

    //   {/* <h1>THE FLYING SQUIRREL</h1> */}
